import React from 'react';
import { Typography } from '@material-ui/core';

export default function Home() {
  return (
    <div style={{ padding: '2rem' }}>
      <Typography variant="h3">Welcome to UlapBiz Dashboard</Typography>
      <p>This is your home page. Let's build cool stuff!</p>
    </div>
  );
}
